/*=======?ui-elemetn======= */

function disableElm(target) {
  $(target).addClass('muted');
}

function enableElm(target) {
  $(target).removeClass('muted');
}

function attachDisplayElement(eOpen, eClose, eTarget) {
  try {
    eOpen.on('click', function () {
      return eTarget.removeClass('hide-item').addClass('show-item');
    });
    eClose.on('click', function () {
      return eTarget.removeClass('show-item').addClass('hide-item');
    });
  } catch (_unused) {
    throw 'Not is JQuery Element';
  }
}
/*=======?popup======= */


function popup(message, resloveName, rejectName, resloveCallback, rejectCallback) {
  var popup = $("<div class=\"popup show-popup\">\n\t\t\t\t\t\t<div class=\"popup-content\">\n\t\t\t\t\t\t\t<p>".concat(message, "</p>\n\t\t\t\t\t\t\t<div class=\"popup-control\">\n\t\t\t\t\t\t\t\t<a control-resolve class=\"btn btn-sm bg-red white\" href=\"#!\">").concat(resloveName, "</a>\n\t\t\t\t\t\t\t\t<a control-reject class=\"btn btn-sm bg-black white\" href=\"#!\">").concat(rejectName, "</a>\n\t\t\t\t\t\t\t</div>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t</div>"));
  popup.find('a[control-resolve]').on('click', function () {
    resloveCallback;
    close();
  });
  popup.find('a[control-reject]').on('click', function () {
    rejectCallback;
    close();
  });

  function close() {
    popup.removeClass('show-popup').addClass('hide-popup');
    setTimeout(function () {
      return popup.remove();
    }, 200);
  }

  $('body').append(popup);
}

