/*=======?helpful======= */


function cvtMoneyToInt(target) {
  if (typeof target == 'string') target = $(target);
  return parseInt(target.text().split(',').join(''));
}

function cvtIntToMoney(val) {
  return new Intl.NumberFormat().format(val);
}
